import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Image, Container } from 'react-bootstrap';

const CarBrands = () => {
    const brands = [
      { name: 'Audi', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/audi.png' },
      { name: 'Citroen', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/citroen.png' },
      { name: 'Ferrari', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/ferrari.png' },
      { name: 'Jaguar', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/jaguar.png' },
      { name: 'Porsche', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/porsche.png' },
      { name: 'Mazda', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/mazda.png' },
      { name: 'Mitsubishi', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/mitsubis.png' },
      { name: 'BMW', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/bmw.png' },
      { name: 'Mercedes Benz', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/mercedes.png' },
      { name: 'Nissan', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/nissan.png' },
      { name: 'Renault', image: 'https://dashboard.codeparrot.ai/api/image/Z7es668BBwoP-o11/renault.png' }
    ];

    return (
      <Container fluid className="py-4" style={{ backgroundColor: '#000', color: '#fff' }}>
        <div className="d-flex justify-content-center align-items-center flex-wrap">
          {brands.map((brand, index) => (
            <div 
              key={index} 
              className="mx-3 my-2 text-center"
            >
              <Image
                src={brand.image}
                alt={`${brand.name} logo`}
                className="img-fluid"
                style={{
                  width: '128px',
                  height: '128px',
                  cursor: 'pointer',
                  transition: 'transform 0.2s'
                }}
                onMouseOver={(e) => e.target.style.transform = 'scale(1.1)'}
                onMouseOut={(e) => e.target.style.transform = 'scale(1)'}
                onClick={() => console.log(`${brand.name} clicked`)}
              />
              <div>{brand.name}</div>
            </div>
          ))}
        </div>
      </Container>
    );
  };
export default CarBrands;
